@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document domain("tubereplay.com") {

body {
    background: none !important;
    background: -moz-radial-gradient(center 45deg, circle farthest-side, #eee 60%, #ccc 100%) !important;
}

img[src="re.png"] { 
height:100px!important; /*width of new image*/
padding-left:350px!important; /*height of new image*/
width:0!important;background-image:url("data:image/png;base64,")!important
 }
 
 input { margin: 0 !important; padding: 0 !important; }
 
input[type="text"] {
 -moz-appearance: none;
height: 32px !important;
font-size: 15px !important;
line-height: 30px !important;
-moz-box-sizing: border-box !important;
border-top-left-radius: 3px !important;
border-bottom-left-radius: 3px !important;
-moz-transition: border-color 0.2s ease 0s !important;
background-color: rgb(255, 255, 255) !important;
border: 1px solid rgb(204, 204, 204);
box-shadow: 0px 1px 2px rgba(0,0,0,.1) inset;
