border-top-color: #a0a0a0;
	box-shadow:inset 0px 1px 2px rgba(0,0,0,0.1) !important;
}

input[type="text"]:focus {
	border:1px solid #4d90fe !important;
	outline:none;
	box-shadow:inset 0px 1px 2px rgba(0,0,0,0.3) !important;
}

#search{
    display: inline-block !important;
}
 
input[type="Submit"] {
display: block !important;
margin-left:  0!important;
height: 32px !important;
font-size: 0 !important;
padding-left: 30px !important;
line-height: 30px !important;
 -moz-appearance: none;
 text-shadow: 0px 1px 0px rgb(255, 255, 255);
 border: 1px solid;
 border-left: none !important;
    border-color: rgb(204, 204, 204) rgb(204, 204, 204) rgb(170, 170, 170);
    border-top-color: rgb(204, 204, 204);
    border-bottom-color: rgb(170, 170, 170);
    background-color: rgb(224, 224, 224);
    background-image: url("data:image/png;base64,") , -moz-linear-gradient(center top , rgb(255, 255, 255) 0px, rgb(224, 224, 224) 100%) !important;
    background-position: center;
    background-repeat: no-repeat , repeat;
    box-shadow: 0px 0px 1px rgb(255, 255, 255) inset;
    border-radius: 0 3px 3px 0 ;
    float: left;
}

input[type="Submit"]:hover{
	border-color:#999 !important;
	box-shadow:0 1px 2px rgba(0,0,0,0.25),inset 0 0 3px #fff !important;
}

input[type="Submit"]:focus{
	outline:none;
	box-shadow:0 0 5px #4496e7,inset 0 0 10px #fff !important;
}

input[type="Submit"]:active{
	border-color:#aaa !important;
	border-bottom-color:#ccc !important;
	border-top-color:#999 !important;
	box-shadow:inset 0 1px 2px #aaa !important;
	background-image:-moz-linear-gradient(top,#e6e6e6 0,#dcdcdc 100%) !important;
}

#mytubereplaycom {
box-shadow: 0 0 20px rgba(0,0,0,.25);
}

table[width="728"] {
